HQ rare promo music video from a promo DVD. &quot;She's Just Killing Me&quot; is a song by rock band ZZ Top, it is their first single released from their 1996 album, Rhythmeen. The song became a pop hit in the US peaking at #12 on the US Singles Chart. The song is featured in the film From Dusk Till Dawn and on the soundtrack which also includes Mexican Blackbird by ZZ Top. 

The music video shows ZZ Top playing in a bar then cuts to video clips from the film From Dusk Till Dawn featuring George Clooney and Salma Hayek.

ZZ Top (pronounced Zee Zee Top) is an American rock band formed in 1969 in Houston, Texas. The band consists of guitarist and lead vocalist Billy Gibbons, bassist and co-lead vocalist Dusty Hill, and drummer Frank Beard. The band and its members went through several reconfigurations throughout 1969, achieving their current form when Hill replaced bassist Billy Etheridge in February 1970, shortly before the band was signed to London Records. Etheridge's departure issued primarily from his unwillingness to be bound by a recording contract.

Since the release of the band's debut album in January 1971, ZZ Top has become known for its strong blues roots and humorous lyrical motifs, relying heavily on double entendres and innuendo. ZZ Top's musical style has changed over the years, beginning with blues-inspired rock on their early albums, then incorporating New Wave, punk rock and dance-rock, with heavy use of synthesizers.

ZZ Top was inducted into the Rock and Roll Hall of Fame in 2004. As a group, ZZ Top possesses 11 gold records and 7 platinum (13 multi-platinum) records; their 1983 album, Eliminator, remains the group's most commercially successful record, selling over 10 million units. ZZ Top also ranks 80th in U.S. album sales, with 25 million units.
